import React from "react";
import Task from "./Task";

function TaskList({task}) {

  const allTasks = task.map((tasks) => {
    return <li key={task}>{tasks}</li> 
  })

  return (
    <div className="tasks">
      {allTasks}
    </div>
  );
}

export default TaskList;
